        private static WordsSearch _search;
        private static WordsSearch GetWordsSearch()
        {
            if (_search == null) {
                Dictionary<string, int> dict = new Dictionary<string, int>();
                var sp = words.Split(',');
                var index = 0;
                foreach (var item in sp) {
                    dict[item] = index;
                    index += item.Length;
                }
                _search = new WordsSearch();
                _search.SetKeywords(dict);
            }
            return _search;
        }


        #endregion

        public static string[] GetPinYinList(string text)
        {
            string[] list = new string[text.Length];
            var pos = GetWordsSearch().FindAll(text);
            foreach (var p in pos) {
                for (int i = 0; i < p.Keyword.Length; i++) {
                    list[i + p.Start] = pyName[wordPy[i + p.Index]];
                }
            }
            for (int i = 0; i < text.Length; i++) {
                if (list[i] != null) continue;
                var c = text[i];
                if (c >= 0x4e00 && c <= 0x9fa5) {
                    var index = c - 0x4e00;
                    var start = pyIndex[index];
                    var end = pyIndex[index + 1];
                    if (end > start) {
                        list[i] = pyName[pyData[start]];
                    }
                }
            }
            return list;
        }
        public static string GetPinYin(string text)
        {
            string[] list = GetPinYinList(text);
            StringBuilder sb = new StringBuilder();
            for (int i = 0; i < list.Length; i++) {
                var s = list[i];
                if (s != null) {
                    sb.Append(list[i]);
                } else {
                    sb.Append(text[i]);
                }
            }
            return sb.ToString();
        }
        public static string GetFirstPinYin(string text)
        {
            string[] list = GetPinYinList(text);
            StringBuilder sb = new StringBuilder(text);
            for (int i = 0; i < list.Length; i++) {
                var c = list[i];
                if (c != null) {
                    sb[i] = c[0];
                }
            }
            return sb.ToString();
        }

        public static List<string> GetAllPinYin(char c)
        {
            if (c >= 0x4e00 && c <= 0x9fa5) {
                var index = c - 0x4e00;
                List<string> list = new List<string>();
                var start = pyIndex[index];
                var end = pyIndex[index + 1];
                if (end > start) {
                    for (int i = start; i < end; i++) {
                        list.Add(pyName[pyData[i]]);
                    }
                }
                return list;
            }
            return new List<string>();
        }

        public static string GetPinYinFast(char c)
        {
            if (c >= 0x4e00 && c <= 0x9fa5) {
                var index = c - 0x4e00;
                var start = pyIndex[index];
                var end = pyIndex[index + 1];
                if (end > start) {
                    return pyName[pyData[start]];
                }
            }
            return c.ToString();
        }

